INSERT INTO `currency_types_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(3319, 'ruRU', 'Знак различия Сумеречного Клинка', 'Адепты Сумеречного Клинка получают эти знаки во время ритуала посвящения. Торговцы в лагере Сумеречного вознесения на Сумеречном нагорье принимают их как доказательство вашего вклада в борьбу с сектантами.', 65727),
(3356, 'ruRU', 'Неиспорченные кристаллы маны', 'Можно получить после достижения 9-го уровня на пути участника вылазки. Добывается из богатых сундуков с помощью отреставрированных ключей в многообещающих вылазках 11-го уровня. Также можно обменять у Зах\'рана на могущественное снаряжение.', 65727),
(2803, 'ruRU', 'Подземная монета', 'С помощью этой валюты исследователи часто обмениваются хитростями и информацией о сокровищах.', 65727);
