INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2743, 'ruRU', 'Штормозлатный небожитель', '|cFFFFD200Внутриигровой магазин|r', 'Гром позолотил его шкуру, а судьба назначила своим избранником. Золотые молнии обвивают его копыта, пронзая небеса всполохами посреди ночной тьмы. В легендах его имя упоминается рядом с именем императора Шаохао.', 65727),
(2742, 'ruRU', 'Громокопытный небожитель', '|cFFFFD200Внутриигровой магазин|r', 'Когда Властелин Грома был повержен, его угасающий грохот слился с духом белого дракона. Он летит в вихре лазурных молний, взвивая облака – где была тирания, теперь льется благодатный свет.', 65727),
(2798, 'ruRU', 'Бронзовый танатокрыл', '|cFFFFD200Достижение: |r\"Укротитель бурных потоков времени IV\"|n|cFFFFD200Категория:|r путешествия во времени|n', 'Хотя жители Ревендрета предпочитают темный зловещий антураж, некоторые из них не против сверкающего великолепия.', 65727),
(2797, 'ruRU', 'Бронзовая трупная муха', '|cFFFFD200Достижение: |r\"Укротитель бурных потоков времени IV\"|n|cFFFFD200Категория:|r путешествия во времени', 'Украсить трупную муху – дело непростое, но некоторые считают, что оно того стоит!', 65727),
(2796, 'ruRU', 'Бронзовый аквилон', '|cFFFFD200Достижение: |r\"Укротитель бурных потоков времени IV\"|n|cFFFFD200Категория:|r путешествия во времени|n|n', 'Надежные скакуны Бастиона созданы так, чтобы соответствовать облику гордых и благородных воинов-перерожденных.', 65727),
(2795, 'ruRU', 'Бронзовый чащобник', '|cFFFFD200Достижение: |r\"Укротитель бурных потоков времени IV\"|n|cFFFFD200Категория:|r путешествия во времени|n|n', 'Наблюдая за тем, как царственные чащобники скользят в небе, чувствуешь безграничную свободу – их магия неподвластна оковам.', 65727),
(1729, 'ruRU', 'Большой Склизь', '|cFFFFD200Задание:|r \"Улитколепно\"|n|cFFFFD200Зона: |rпещера Заралек', 'Большое сердце, большие мечты, Большой Склизь.', 65727);
